INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (1, "2020/04/30 12:00:00", 102601, 24, 24001, 0.0, 0, 0.0, "2030/12/17 14:59:59", "リン", 1, 10040, "あたしだって\nやるときはやるよ！", 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (1, "2020/04/30 12:00:00", 102601, 24, 24002, 0.0, 1, 0.0, "2030/12/17 14:59:59", "リン", 1, 10040, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (1, "2020/04/30 12:00:00", 102601, 24, 24003, 0.0, 2, 0.0, "2030/12/17 14:59:59", "リン", 1, 10040, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (2, "2020/04/30 12:00:00", 102601, 24, 24004, 0.0, 3, 0.0, "2030/12/17 14:59:59", "リン", 2, 10040, "やったね！\nこれでようやく\nサボれるよ…", 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (1, "2020/04/30 12:00:00", 102601, 24, 24005, 0.0, 4, 0.0, "2030/12/17 14:59:59", "リン", 1, 10040, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (2, "2020/04/30 12:00:00", 102601, 24, 24006, 0.0, 5, 0.0, "2030/12/17 14:59:59", "リン", 2, 10040, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (2, "2020/04/30 12:00:00", 102601, 24, 24007, 0.0, 6, 0.0, "2030/12/17 14:59:59", "リン", 2, 10040, "あたしも意外と\nやるもんでしょ？", 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (4, "2020/04/30 12:00:00", 102601, 24, 24008, 0.0, 7, 0.0, "2030/12/17 14:59:59", "リン", 4, 10040, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (4, "2020/04/30 12:00:00", 102601, 24, 24009, 0.0, 8, 0.0, "2030/12/17 14:59:59", "リン", 4, 10040, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (4, "2020/04/30 12:00:00", 102601, 24, 24010, 0.0, 9, 0.0, "2030/12/17 14:59:59", "リン", 4, 10040, "まじめに\nやったんだけどな…\n悔しいな～", 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (4, "2020/04/30 12:00:00", 102601, 24, 24011, 0.0, 10, 0.0, "2030/12/17 14:59:59", "リン", 4, 10040, "やられた…\nねずみって意外と\nてごわいね", 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (4, "2020/04/30 12:00:00", 102601, 24, 24012, 0.0, 11, 0.0, "2030/12/17 14:59:59", "リン", 4, 10040, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0);
INSERT INTO `v1_ab6d366add2a313159d5f0dc8f1bd9a61aeac32ea1dde5c2aa30cdfc13ef6f24` VALUES (4, "2020/04/30 12:00:00", 102601, 24, 24013, 0.0, 12, 1.81, "2030/12/17 14:59:59", "リン", 1, 10040, "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0);
